import './App.css';
import TodoContainer from './components/TodoContainer/index';
import TodoTitleArea from './components/TodoTitleArea/index';
import { useState } from 'react';

function App() {
  const [todos, setTodos] = useState([
    {
      title: '집에 가기',
      content: '집에 가고 싶다',
    },
    {
      title: '점심 먹기',
      content: '밥먹고 집에 가고 싶다',
    },
  ]);
  return (
    <div className='App'>
      <TodoTitleArea />
      <TodoContainer />
    </div>
  );
}

export default App;
